settings.cardCss:
.card {
   width: 100%;
   height: 100%;
   box-sizing: border-box;
}

.card .content {
   padding: 20px;
   display: flex;
   flex-direction: row;
   align-items: center;
   height: 100%;
   box-sizing: border-box;
}

.card .content .column {
   display: flex;
   flex-direction: column;    
   height: 100%;
}

.card h1 {
    text-transform: uppercase;
    color: #777;
    font-size: 18px;
    font-weight: bold;
    margin: 0;
    padding-bottom: 6px;
    line-height: 20px;
}

.card h2 {
    color: #333;
    font-size: 16px;
    font-weight: bold;
    margin: 0;
    padding-bottom: 10px;
    line-height: 20px;
}

.card h3 {
    color: #666;
    font-size: 14px;
    font-weight: bold;
    margin: 0;
    padding-bottom: 6px;
    padding-top: 14px;
    line-height: 18px;
}

.card .value {
    font-size: 14px;
    font-weight: 300;
}

.card .description {
    font-size: 20px;
    color: #999;
}

.card i.fa {
    font-size: 20px;
    padding-right: 10px;
}

.card-with-background {
    position: relative; /* Allows positioning child elements */
    overflow: hidden; /* Ensures the background stays within bounds */
    padding: 20px; /* Add padding for inner content */
    color: white; /* Text color for readability */
    border-radius: 8px; /* Optional: rounded corners */
}

.card-with-background::before {
    content: ''; /* Creates a pseudo-element for the background */
    position: absolute; /* Positions it behind the content */
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    background: url('/api/images/public/oJSTViwvZllS4NvoGniJcoAo1GgbPcTI/SOLAR_BUILDING.jpg') no-repeat center center;
    background-size: cover; /* Scales the image to cover the entire card */
    filter: blur(8px); /* Applies the blur effect to the background */
    opacity: 0.2; /* Reduces the visibility of the background */
    z-index: 0; /* Places the pseudo-element behind the content */
}

.card-with-background .content {
    position: relative; /* Ensures the content is above the background */
    z-index: 1; /* Places content above the pseudo-element */
}

